    [Parameter]
    public string id { get; set; }
    Tax objarea = new Tax();
    Privilege privi = new Privilege();
    //GetSessionInfo
    long CompanyId;
    long RoleId;
    long FinancialYearId;
    long UserId;
    string Email;
    string strMenu = "Tax";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    protected async override void OnInitialized()
    {
        Email = await sessionStorage.GetItemAsync<string>("Email");
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        FinancialYearId = await sessionStorage.GetItemAsync<long>("FinancialYearId");
        UserId = await sessionStorage.GetItemAsync<long>("UserId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        objarea = areaservices.EditTax(Convert.ToInt64(id));
        StateHasChanged();
    }
    public async Task HandleValidSubmit()
    {
        if (strEdit == true)
        {
            var isCheck = areaservices.CheckTaxId(objarea.TaxName);
            if (isCheck == objarea.TaxId || isCheck == 0)
            {
                objarea.ApplicableOn = "Product";
                objarea.CalculatingMode = "Rate";
                objarea.IsActive = true;
                objarea.ModifyDate = DateTime.Now;
                areaservices.UpdateTax(objarea);
                Toaster.Add("Saved Successfully.", MatToastType.Success, "Counter", null);
                navManager.NavigateTo("taxlist");
            }
            else
            {
                Toaster.Add("Already Exists.", MatToastType.Info, "Counter", null);
                navManager.NavigateTo("taxlist");
            }
        }
        else
        {
            Toaster.Add("You dont have to privilege.", MatToastType.Success, "Dashboard", null);
            navManager.NavigateTo("dashboard");
        }
    }
    void Cancel()
    {
        navManager.NavigateTo("taxlist");
    }

